import "./portfolio.css"
import Footer from "../footer/footer"

function portfolio(){
    return(
        <>
        <div className="portfolio" id="portfolio">
            <h1>Portfolio</h1>
            <div className="footer">
                <Footer/>
            </div>

        </div>
        </>
    )
};
export default portfolio
